    class Nicknames
    {
        public static List<string> FriendlyNicknames = new List<string>() { "Buddy", "Pal", "Guy", "Fwiend", "Pardner", "Dude" };
        public static List<string> VeryFriendlyNicknames = new List<string>() { "Fam", "My Dude", "My Dear Friend", "Comrade", "Champ", "Bae" };
        public static List<string> UnfriendlyNicknames = new List<string>() { "Meatbag", "human", "Jerk", "Punk", "Jerkwad", "Dingbat" };
        public static List<string> VeryUnfriendlyNicknames = new List<string>() { "Asshat", "Jackass", "Connard", "Meatsac", "Douche", "Wassock" };

        public static string GetNickname(double Favorability)
        {
            if (Favorability > 500) return VeryFriendlyNicknames.GetRandom();
            else if (Favorability > 150) return FriendlyNicknames.GetRandom();
            else if (Favorability < -500) return VeryUnfriendlyNicknames.GetRandom();
            else if (Favorability < -150) return FriendlyNicknames.GetRandom();
            else return "Human";
        }
    }
